import React from 'react'
import '../style/card.css'

function Card(props) {
  return (
    <>
      <div className="card-item-container">
        <div className="card-item-sub-container">
            <h1>{props.sName}</h1>
            <p>{`* ${props.sType} available`}</p>
            <p>{props.sLoc}</p>
        </div>
      </div>
    </>
  );
}

export default Card
